import React from "react";
import { ICoins } from "../models";

interface IPropsCoins {
  coins: ICoins[];
}

export default function Coins(props: IPropsCoins) {
  return (
    <div className="wrapper">
      <div>
        <div className="heading">
          <p>#</p>
          <p>Coin</p>
          <p>Price</p>
          <p>24h</p>
          <p>Volume</p>
          <p>Market Cap</p>
        </div>
      </div>
    </div>
  );
}
